// frontend/src/components/AssetForm.js
import React from 'react';

const AssetForm = () => {
  return (
    <div className="form-container">
      <label>Action Owner</label>
      <input type="text" placeholder="Enter Action Owner" />
    </div>
  );
};

export default AssetForm;
